import React, { ChangeEvent, useState } from 'react';
import ReactDOM from 'react-dom';



import './App.css';



const Bla =()=> {
    let [users,setUsers]=useState([
        {
            id : 1,
            name: "Dima",
            age: 23,
            isLoged : true},
        {
            id: 2,
            name: "Vika",
            age : 16,
            isLoged: false
        }
    ])

    let useres =[         {
            id : 1,
            name: "Dima",
            age: 23,
            isLoged : true},
        {
            id: 2,
            name: "Vika",
            age : 16,
            isLoged: false
        }]

    console.log(useres)

    let funct = () => {
        // eslint-disable-next-line @typescript-eslint/no-unused-expressions
        useres[useres.length] = { id: 3,
            name: "Vitya",
            age : 32,
            isLoged: true}

        return useres.map((el) => el.name === "Vika" ? {...el, name:"BNB"} : el);
    }

    funct()
    console.log(funct())








    const onclickHandler =()=> {
       let fil=users.filter((el)=>el.age>18)

        setUsers(fil)
    }

    const onclickHandler2 = ()=> {

        let fil=users.filter((el)=>el.age<18)
        setUsers(fil)


    }


    const onclickHandler3 = (id:any)=> {

        setUsers(users.map((el) => el.id === id ? {...el, name:"BKB"} : el))
    }


    return (
        <div className="App">
            {users.map((el)=>{
                return(
                    <div>
                        {el.name}
                        <button onClick={() => onclickHandler3(el.id)}>rename</button>

                    </div>

                )

            })}
            <button onClick={onclickHandler}>filter</button>
            <button onClick={onclickHandler2}>filter2</button>


        </div>
    );
}

